import { useRouter } from 'next/router';


const Hashtag = () => {
    const router = useRouter();
    const { tag } = router.query;

    return (
        <div>
            해쉬 태그 페이지 <br/>
            해쉬 태그 : {tag}
        </div>
    )
}

export default Hashtag
